<body>
    <script>
        function cube(){
            let sum=0
            let m=prompt()
            let n=prompt()
            if(m>n){
                console.log(0)
            }
            for(m;m<=n;m++){
                sum+=m*m*m
                
            }
            console.log(sum)
        }
        cube()
    </script>
